import React, { Component } from "react";

export default class AddFishForm extends Component {
  render() {
    return (
      <form className="fish-edit">
        <input type="text" className="name" placeholder="Name" />
        <input type="text" className="price" placeholder="Price" />
        <input type="text" className="status" placeholder="Status" />
        <input type="text" className="desc" placeholder="Desc" />
        <input type="text" className="image" placeholder="Image" />
      </form>
    );
  }
}
